  height: 2px;
  background: transparent;
}
.menu-btn > span:nth-child(2) > span {
  display: block;
  width: 100%;
  height: 2px;
  background: #131311;
  position: absolute;
  transition: 0.5s ease;
}
.menu-btn > span:nth-child(2) .rotate45 {
  transform: rotate(45deg);
}
.menu-btn > span:nth-child(2) .rotate-45 {
  transform: rotate(-45deg);
}
.menu-btn > span:nth-child(3) {
  width: 50%;
  height: 2px;
  float: right;
}
.menu-btn .opacity0 {
  opacity: 0;
}

.menuArea {
  visibility: hidden;
  opacity: 0;
  position: fixed;
  transition: 0.5s ease;
  z-index: 990;
}

.menu-show {
  visibility: visible;
  opacity: 1;
}
.menu-show .menu {
  transform: translateX(0);
}

.menu-block {
  width: 100%;
  height: 100vh;
  background: rgba(19, 19, 17, 0.35);
  position: fixed;
  top: 0;
  left: 0;
}

.menu {
  width: 540px;
  height: 100%;
  background: #fff;
  position: fixed;
  top: 0;
  right: 0;
  padding: 45px 50px 10px;
  transform: translateX(1000px);
  transition: 1s;
  display: flex;
  flex-direction: column;
  justify-content: space-between;
}

.menu-top {
  display: flex;
  align-items: flex-start;
  margin-bottom: 50px;
}
.menu-top .headerBookingBox,
.menu-top .languageBox {
  opacity: 0;
  transform: translateY(-20px);
  z-index: 10;
}
.menu-top .headerBookingBox > a {
  margin: 0;
  padding: 12px 40px;
  clip-path: none;
  background: #bca480;
  color: #fff;
}
.menu-top .headerBooking > li > a {
  width: calc(100% - 20px);
  background: #fff;
}
.menu-top .headerBooking > li:hover > a {
  background: #bca480;
}
.menu-top .languageBox {
  margin: 0 80px 0 20px;
}
.menu-top span::after {
  content: "";
  display: inline-block;
  background-color: #dedede;
  width: 1px;
  height: 13px;
  transform: translateX(45px);
}
.menu-top .language > li > a {
  padding: 12px 0;
}

.menu-top .menuShow {
  opacity: 1;
  transform: translateY(0);
  transition: 0.7s ease;
  transition-delay: 0.8s;
}

.menuBox {
  margin-top: 10%;
}

.menuBox h2 {
  position: relative;
  padding-bottom: 25px;
  margin-bottom: 25px;
  font-family: "微軟正黑體";
  font-size: 18px;
  font-weight: 600;
  letter-spacing: 3px;
}
.menuBox h2 span {
  font-family: sans-serif;
}
.menuBox h2::after {
  content: "";
  background: #bca480;
  position: absolute;
  left: 0;
  bottom: 0;
  width: 50px;
  height: 1px;
}

.menu-item {
  display: flex;
  flex-wrap: wrap;
}
.menu-item li {
  width: 25%;
  margin-bottom: 27px;
  transition: 0.5s ease;
}
.menu-item li a {
  transition: 0.5s ease;
  font-size: 16px;
  color: #131311;
  font-family: "微軟正黑體";
  letter-spacing: 1px;
}
.menu-item li a::after {
  content: "/";
  opacity: 0.3;
  color: #131311;
  font-size: 13px;
  margin-left: 17px;
}
.menu-item li:hover a {
  color: #bca480;
}
.menu-item li:last-child a::after {
  content: "";
}

.menu-bottom {
  margin-top: auto;
}

.social {
  text-align: right;
  border-bottom: 1px solid #eee;
  padding-bottom: 5px;
  margin-bottom: 15px;
  opacity: 0;
  transition: 0.5s ease;
  transform: translateY(-20px);
}
.social > a {
  display: inline-block;
  width: 30px;
  height: 30px;
  line-height: 30px;
  font-size: 18px;
  color: #8a7b73;
  text-align: center;
  margin: 0 5px;
  transition: 0.5s ease;
}
.social > a > svg {
  fill: #8a7b73;
  transform: translateY(2px);
  width: 18px;
  height: 18px;
}
.social > a:hover {
  opacity: 0.8;
}

.copyrightBox {
  font-family: "微軟正黑體";
  opacity: 0;
  transform: translateY(-20px);
}
.copyrightBox h5 {
  font-size: 13px;
  line-height: 23px;
  color: #818181;
}
.copyrightBox p {
  font-size: 12px;
  color: #bbb;
}
.copyrightBox p a {
  color: #bbb;
  font-family: sans-serif;
}
.copyrightBox p a:hover {
  text-decoration: underline;
}

.menuBox h2,
.menuBox .menu-item {
  opacity: 0;
  transform: translateY(-20px);
}
.menuBox .menuShow {
  opacity: 1;
  transform: translateY(0);
  transition: 0.7s ease;
  transition-delay: 1.2s;
}

.menuShow .social,
.menuShow .copyrightBox {
  opacity: 1;
  transition: 0.5s ease;
  transition-delay: 1.7s;
  transform: translateY(0);
}

.btn-change {
  transform: translateY(-30px);
}

.btn-show {
  transform: translateY(0);
}

