.loading {
  width: 100%;
  height: 100vh;
  background: #bca480;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  position: fixed;
  left: 0;
  top: 0;
  z-index: 10000;
  display: none;
  opacity: 0;
  transition: 0.5s;
}

.loading img {
  width: 50px;
  animation: imgin 0.8s ease-in-out;
}

@keyframes imgin {
  0% {
    opacity: 0;
    transform: translateX(30px);
  }
  100% {
    opacity: 1;
    transform: translateX(0);
  }
}
.loading::after {
  content: "";
  display: block;
  width: 160px;
  height: 40px;
  background: url("/398f8cf898f39fb836556fb53d5faefe.png") no-repeat;
  background-size: contain;
  margin-top: 8px;
  animation: logoin 1.2s ease-in-out 0.8s;
  opacity: 0;
}

@keyframes logoin {
  0% {
    opacity: 0;
  }
  100% {
    opacity: 1;
  }
}
.loading.show {
  display: flex;
  overflow-y: hidden;
  pointer-events: unset;
  opacity: 1;
}

sources.css\\all.scss:
$color-main: #bca480;
$color-black: #131311;
$color-white: #fff;
$font-noto: "Noto Sans TC", sans-serif;
$font-chinese: "微軟正黑體";
$font-eng: sans-serif;

* {
  margin: 0;
  padding: 0;
  outline: none;
  position: relative;
  box-sizing: border-box;
}
body{
  position: relative;
  overflow-x: hidden;

}
body.noScroll{
  overflow-y: hidden;
}
.wrap {
  position: relative;
  width: 1200px;
  margin: 0 auto;
}
a {
  text-decoration: none;
}
ul {
  list-style: none;
}
#wrapper{
    position: relative;
}

sources.css\\header.scss:
header {
  position: fixed;
  top: 0;
  width: 100%;
  z-index: 801;
  transition: 0.5s ease;
  nav {
    // width: 100%;
    padding: 0 50px;
    position: relative;
    display: flex;
    justify-content: space-between;
    .rightBox {
      display: flex;
      margin-top: 45px;
      transition: 0.5s ease;
    }
  }
}

.logo {
  margin: 45px 0 0 0;
  position: relative;
  width: 210px;
  transition: 0.5s ease;
  a {
    display: block;
    height: 50px;
    background: url(../images/logo_white.png) no-repeat;
    background-size: contain;
  }
}
.headerList {
  padding: 10px 15px 0 0;
  transition: 0.5s ease;
  display: none;
  > a {
    display: inline-block;
    padding: 0;
    font-size: 15px;
    font-family: $font-chinese;
    color: #5c5c5c;
    letter-spacing: 1px;
    transition: 0.5s ease;
    opacity: 0;
    &:hover {
      color: $color-main;
    }
  }
}
.headerBookingBox {
  display: inline-block;
  height: 50px;
  > a {
    color: $color-main;
    background-color: $color-white;
    display: inline-block;
    margin-right: 40px;
    padding: 15px 70px;
    clip-path: polygon(0 0, 100% 0%, 91.5% 100%, 0% 100%);
    font-size: 13px;
    font-family: $font-noto;
    letter-spacing: 1px;
    transition: 0.5s ease;
    cursor: pointer;

    &:hover {
      background-color: $color-main;
      color: $color-white;
    }
  }
  ul {
    visibility: hidden;
    transform: translateY(8px);
    transition: 0.5s ease;
    opacity: 0;
  }
  ul a {
    display: inline-block;
    color: $color-black;
    background-color: rgba($color-white, 0.7);
    padding: 10px;
    width: calc(100% - 65px);
    text-align: center;
    font-size: 13px;
    font-family: $font-noto;
    &:hover {
      transition: 0.5s ease;
      background-color: $color-main;
      color: $color-white;
    }
  }
  .show {
    visibility: visible;
    transform: translateY(0);
    opacity: 1;
  }
}

.languageBox {
  margin: 0 70px 0 20px;
  display: inline-block;
  height: 50px;
  span {
    padding: 15px 50px;
    color: $color-main;
    background: transparent;
    display: inline-block;
    text-transform: uppercase;
    font-family: $font-chinese;
    font-size: 13px;
    transition: 0.5s ease;
    &:hover {
      cursor: pointer;
      color: $color-black;
    }
    i {
      margin-left: 5px;
      font-size: 12px;
    }
  }
  ul {
    width: 100%;
    visibility: hidden;
    box-shadow: 0px 3px 10px rgba($color-black, 0.1);
    transform: translateY(-8px);
    transition: 0.5s ease;
    opacity: 0;
  }
  ul a {
    display: inline-block;
    color: $color-black;
    background: $color-white;
    padding: 15px 5px;
    width: 100%;
    text-align: center;
    font-size: 13px;
    font-family: $font-noto;
    border-bottom: 1px solid rgba(0, 0, 0, 0.05);

    &:hover {
      color: $color-main;
    }
  }
  .show {
    visibility: visible;
    transform: translateY(0);
    opacity: 1;
  }
}

.change {
  background: $color-white;
  box-shadow: 0px 5px 50px rgba(54, 53, 53, 0.1);
  z-index: 802;

  .logo {
    margin: 10px 0;
    a {
      background: url("../images/logo.png") no-repeat;
      background-size: contain;
    }
  }
  .rightBox {
    margin: 15px 0;
  }
  .headerList {
    display: block;
    > a {
      padding: 0 10px;
      opacity: 1;
    }
  }
  .headerBookingBox {
    height: 45px;
  }
  .headerBookingBox > a {
    clip-path: none;
    color: $color-white;
    background: $color-main;
    padding: 12px 40px;
    margin: 0;
  }
  .headerBookingBox ul li a {
    width: 100%;
  }
  .languageBox {
    height: 45px;
    margin: 0 100px 0 20px;
    > span {
      padding: 12px 30px;
    }
  }
}

sources.css\\ytbg.scss:
#ytbg-wrapper {
  position: relative;
  z-index: 0;
}
#ytbg-container {
  height: 100vh;
}

#ytbg-title {
  color: $color-white;
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-70%, -50%);

  font-family: $font-eng;
  font-weight: 300;
  font-size: 70px;
}

#ytbg-img {
  position: absolute;
  top: 0;
  right: 0;
  width: 980px;
  height: 100%;
  background: url("../images/cA.png") no-repeat left top {
    size: cover;
  }
}

.gif-static {
  background: url("../images/gif_static.png") no-repeat 60px bottom;
  position: absolute;
  bottom: -5px;
  width: 100%;
  height: 60px;
  overflow: hidden;
  div {
    position: absolute;
    img {
      height: 55px;
    }
  }
  @keyframes walk {
    0% {
      left: 100%;
    }
    100% {
      left: 0%;
    }
  }
  @keyframes walk2 {
    0% {
      right: 100%;
    }
    100% {
      right: 0%;
    }
  }

  .service01 {
    animation: walk2 100s -28s infinite linear;
  }
  .service02 {
    animation: walk 100s -70s infinite linear;
  }
  .service03 {
    left: 7%;
    bottom: -1px;
  }
  .service04 {
    animation: walk2 100s -64s infinite linear;
  }
  .traveler01 {
    animation: walk2 100s -7s infinite linear;
  }
  .traveler02 {
    animation: walk 100s -50s infinite linear;
  }
  .traveler03 {
    animation: walk 100s -20s infinite linear;
  }
  .traveler04 {
    animation: walk 100s -35s infinite linear;
  }
}

