      @keyframes btnAni {
        50% {
        }
        100% {
          transform: scale(1.3);
          opacity: 0;
        }
      }
    }
    a::after {
      @extend .button;
      display: block;
      margin: 0;
      position: absolute;
      top: 0;
      z-index: -1;
      content: "";
      opacity: 0.8;
      animation: btnAni02 1.25s 0.25s infinite cubic-bezier(0.66, 0, 0, 1);
      @keyframes btnAni02 {
        100% {
          transform: scale(1.3);
          opacity: 0;
        }
      }
    }
  }
