.newsArea{
    position: relative;
    margin-bottom: 100px;
    width: 100%;
    .line{
        width: 100%;
        border-top: 2px solid $color-black;
        position: absolute;
        top: 50%;
        z-index: -1;
        opacity: .2;
    }
    
}
.slider-wrap {
  position: relative;
  width: 1260px;
  margin: 0 auto;
.slider {
  .content {
    // margin: 0 30px;
    .img{
        height: 160px;
    }
  }
  img {
    height: 100%;
    width: 100%;
    object-fit: cover;
  }
  }
}

.card {
  opacity: 0.5;
  transition: 0.5s ease;
  margin: 0 30px;

  &:hover {
    opacity: 1;
    .card-btn {
      opacity: 0.5;
      background: $color-main;
      color: $color-white;
      &:hover {
        opacity: 1;
      }
    }
  }
}

.txtBox {
  padding: 20px 30px 35px;
  background: $color-white;
}
.card-date {
  color: $color-main;
  font-size: 12px;
  font-family: $font-eng;
  font-weight: 300;
  margin-bottom: 10px;
}
.card-title {
  display: inline-block;
  margin-bottom: 25px;
  height: 56px;
  h3{
    color: $color-black;
    font-size: 18px;
    font-family: $font-chinese;
    font-weight: normal;
    line-height: 28px;

  
  }
}
.card-text {
  color: $color-black;
  font-size: 15px;
  font-family: $font-chinese;
  margin-bottom: 20px;
  height: 75px;
  line-height: 25px;
  letter-spacing: 1px;
}
.card-btn {
  display: inline-block;
  margin-left: -42px;
  padding: 20px 40px;
  color: $color-main;
  text-transform: uppercase;
  font-family: $font-eng;
  font-size: 12px;
  box-shadow: 0px 1px 3px #888;
  transition: 0.5s ease;
  letter-spacing: 2px;
}

.sliderBtn {
  display: block;
  position: absolute;
  top: calc(50% - 35px);
  padding: 20px 30px;
  i {
    font-size: 30px;
    color: $color-black;
    opacity: 0.7;
    &:hover {
      cursor: pointer;
    }
  }
}
.sliderBtnPrev {
  left: -70px;
}
.sliderBtnNext {
  right: -70px;
}

.newsArea .dotBox{
  width: 100%;
  text-align: center;
  display: none;
}

