.menu-btn {
  width: 48px;
  height: 32px;
  position: fixed;
  top: 50px;
  right: 50px;
  z-index: 999;
  visibility: visible;
  transition: 0.5s ease;
  &:hover {
    cursor: pointer;
    span:nth-child(3) {
      width: 100%;
    }
  }
  span {
    display: block;
    background: $color-black;
    transition: 0.5s ease;
  }
  > span:nth-child(1) {
    width: 100%;
    height: 2px;
  }
  > span:nth-child(2) {
    margin: 13px auto;
    width: 100%;
    height: 2px;
    background: transparent;
    > span {
      display: block;
      width: 100%;
      height: 2px;
      background: $color-black;
      position: absolute;
      transition: 0.5s ease;
    }
    .rotate45 {
      transform: rotate(45deg);
    }
    .rotate-45 {
      transform: rotate(-45deg);
    }
  }
  > span:nth-child(3) {
    width: 50%;
    height: 2px;
    float: right;
  }
  .opacity0 {
    opacity: 0;
  }
}

.menuArea {
  visibility: hidden;
  opacity: 0;
  position: fixed;
  transition: 0.5s ease;
  z-index: 990;
}
.menu-show {
  visibility: visible;
  opacity: 1;
  .menu {
    transform: translateX(0);
  }
}

.menu-block {
  width: 100%;
  height: 100vh;
  background: rgba($color-black, 0.35);
  position: fixed;
  top: 0;
  left: 0;
  // z-index: 990;
}
.menu {
  width: 540px;
  height: 100%;
  background: $color-white;
  position: fixed;
  top: 0;
  right: 0;
  padding: 45px 50px 10px;
  transform: translateX(1000px);
  transition: 1s;
  display: flex;
  flex-direction: column;
  justify-content: space-between;
}
.menu-top {
  display: flex;
  align-items: flex-start;
  margin-bottom: 50px;
  .headerBookingBox,
  .languageBox {
    opacity: 0;
    transform: translateY(-20px);
    z-index: 10;
  }
  .headerBookingBox > a {
    margin: 0;
    padding: 12px 40px;
    clip-path: none;
    background: $color-main;
    color: $color-white;
  }
  .headerBooking > li {
    > a {
      width: calc(100% - 20px);
      background: $color-white;
    }
    &:hover > a {
      background: $color-main;
    }
  }
  .languageBox {
    margin: 0 80px 0 20px;
  }
  span::after {
    content: "";
    display: inline-block;
    background-color: #dedede;
    width: 1px;
    height: 13px;
    transform: translateX(45px);
  }
  .language > li > a {
    padding: 12px 0;
  }
}
.menu-top .menuShow {
  opacity: 1;
  transform: translateY(0);
  transition: 0.7s ease;
  transition-delay: 0.8s;
}
.menuBox {
  margin-top: 10%;
}
.menuBox h2 {
  position: relative;
  padding-bottom: 25px;
  margin-bottom: 25px;
  font-family: $font-chinese;
  font-size: 18px;
  font-weight: 600;
  letter-spacing: 3px;
  span {
    font-family: $font-eng;
  }
  &::after {
    content: "";
    background: $color-main;
    position: absolute;
    left: 0;
    bottom: 0;
    width: 50px;
    height: 1px;
  }
}
.menu-item {
  display: flex;
  flex-wrap: wrap;
  li {
    width: 25%;
    margin-bottom: 27px;
    transition: 0.5s ease;
    a {
      transition: 0.5s ease;
      font-size: 16px;
      color: $color-black;
      font-family: $font-chinese;
      letter-spacing: 1px;
      &::after {
        content: "/";
        opacity: 0.3;
        color: $color-black;
        font-size: 13px;
        margin-left: 17px;
      }
    }
    &:hover a {
      color: $color-main;
    }
  }
  li:last-child a {
    &::after {
      content: "";
    }
  }
}
.menu-bottom {
  margin-top: auto;
}
.social {
  text-align: right;
  border-bottom: 1px solid #eee;
  padding-bottom: 5px;
  margin-bottom: 15px;
  opacity: 0;
  transition: 0.5s ease;
  transform: translateY(-20px);

  > a {
    display: inline-block;
    width: 30px;
    height: 30px;
    line-height: 30px;
    font-size: 18px;
    color: #8a7b73;
    text-align: center;
    margin: 0 5px;
    transition: 0.5s ease;
    > svg {
      fill: #8a7b73;
      transform: translateY(2px);
      width: 18px;
      height: 18px;
    }
    &:hover {
      opacity: 0.8;
    }
  }
}
.copyrightBox {
  font-family: $font-chinese;
  opacity: 0;
  transform: translateY(-20px);

  h5 {
    font-size: 13px;
    line-height: 23px;
    color: #818181;
  }
  p {
    font-size: 12px;
    color: #bbb;

    a {
      color: #bbb;
      font-family: $font-eng;
      &:hover {
        text-decoration: underline;
      }
    }
  }
}
.menuBox {
  h2,
  .menu-item {
    opacity: 0;
    transform: translateY(-20px);
  }
  .menuShow {
    opacity: 1;
    transform: translateY(0);
    transition: 0.7s ease;
    transition-delay: 1.2s;
  }
}
.menuShow {
  .social,
  .copyrightBox {
    opacity: 1;
    transition: 0.5s ease;
    transition-delay: 1.7s;
    transform: translateY(0);
  }
}
.btn-change {
  transform: translateY(-30px);
  // top: 20px;
}
.btn-show {
  transform: translateY(0);
}

sources.css\\rwd.scss:
@media screen and (max-width: 1420px) {
  #ytbg-title {
    font-size: 52px;
    left: 40%;
  }
  .slider-wrap {
    width: 100%;
  }

  .sliderBtnPrev,
  .sliderBtnNext {
    display: none;
  }
  .newsArea .dotBox {
    display: block;
  }
  .newsArea .dotBox a:nth-child(3) {
    display: none;
  }
}
@media screen and (max-width: 1350px) {
  .change .headerList > a {
    padding: 0 2px;
  }
}
@media screen and (max-width: 1245px) {
  .change .headerList > a {
    padding: 0;
  }
  .slider-wrap {
    padding: 0 20px;
  }
}

@media screen and (max-width: 1230px) {
  #ytbg-title {
    font-size: 52px;
    left: 75%;
    width: 100%;
  }

  #ytbg-img {
    display: none;
  }
  header .headerBookingBox > a {
    margin-right: 0;
  }
  header .languageBox span {
    color: $color-white;
  }
  .change .headerList {
    display: none;
  }
  .change .languageBox > span {
    color: $color-main;
  }
  .wrap {
    width: 100%;
    padding: 0 20px;
  }
  .aboutArea {
    margin-top: 50px;
  }
  .card {
    margin: 0 10px;
  }
  .linkArea {
    margin-bottom: 135px;
  }
  .link-txt {
    bottom: -45px;
    left: 520px;
  }
  .featureArea {
    .img1 {
      width: 100%;
      height: auto;
    }
    .img2,
    .img3 {
      display: none;
    }
  }
  .featureList .item .txt {
    width: 100%;
    padding: 40px 0;
    > * {
      margin: auto 40px;
    }
  }
  .featureArea .dotBox {
    position: relative;
    width: 100%;
    bottom: auto;
  }
  .featureArea .item div img {
    width: 100%;
  }
  .menu-btn {
    span,
    > span:nth-child(2) span {
      background: $color-white;
    }
  }
  .btn-show,
  .btn-change {
    span,
    > span:nth-child(2) span {
      background: $color-black;
    }
  }
}
@media screen and (max-width: 1024px) {
  body {
    overflow-x: hidden;
  }
  header {
    .headerBookingBox,
    .languageBox {
      display: none;
    }
  }
  .aboutArea {
    flex-direction: column;
    .text {
      width: 100%;
    }
    .button {
      border-radius: 0;
      width: 250px;
      height: 50px;
      margin-left: 0;
      margin-top: 30px;
      .button-a {
        line-height: 50px;
        &::before,
        &::after {
          display: none;
        }
      }
    }
  }
}
@media screen and (max-width: 960px) {
  .logo a {
    height: 40px;
  }
  .btn-change {
    transform: translateY(-35px);
  }
  .btn-show {
    transform: translateY(0);
  }
  .linkArea {
    .link-txt,
    .space {
      display: none;
    }
  }
  .linkArea {
    .link-leftBox,
    .link-rightBox {
      .imgBox {
        height: 100%;
        a {
          height: 100%;
        }
      }
      .txt {
        width: auto;
        padding: 50px;
        h3 {
          margin-bottom: 10px;
        }
        h3 a {
          font-size: 27px;
        }
        p {
          line-height: 20px;
          letter-spacing: 0.5px;
        }
      }
    }
  }
  .link-leftBox .ring {
    display: none;
  }
  .menu-down {
    transform: translateY(0);
  }
  .menu-down.hide {
    transform: translateY(60px);
  }
  footer {
    flex-direction: column;
    align-items: center;
    .footer-leftBox,
    .footer-rightBox {
      width: 100%;
      text-align: center;
    }
  }
  footer .social {
    text-align: center;
  }
  footer .footer-rightBox {
    margin-bottom: 60px;
  }
  footer .footer-rightBox img {
    clear: both;
    float: none;
  }
}
@media screen and (max-width: 767px) {
  header nav {
    padding: 0 20px;
  }
  .menu-btn {
    right: 20px;
  }
  #ytbg-title {
    font-size: 39px;
  }
  #ytbg-container {
    height: 70vh;
  }
  .newsArea .dotBox a:nth-child(3) {
    display: inline-block;
  }

  .linkArea {
    flex-direction: column-reverse;
    margin-bottom: 50px;
    .link-leftBox,
    .link-rightBox {
      width: 100%;
    }
    .link-rightBox {
      display: flex;
      flex-direction: column-reverse;
      margin-top: 20px;
    }
  }

  .featureArea {
    // margin-bottom: 0;
  }
  .mapArea {
    margin-bottom: 0;
  }
  #map {
    display: none;
  }
  .bookArea {
    position: relative;
    box-sizing: border-box;
    width: 100%;
    padding: 0;
  }
  .bookArea.map {
    margin: 0;
  }
  .bookBox {
    width: 100%;
    padding: 40px;
    box-sizing: border-box;
  }
  .menu {
    width: 100vw;
    height: 100vh;
    box-sizing: border-box;
  }
}
@media screen and (max-width: 500px) {
  .wrap {
    box-sizing: border-box;
  }
  .aboutArea .text h2 {
    font-size: 24px;
  }
  .slider-wrap {
    padding: 0;
  }
  .newsArea .dotBox {
    display: none;
  }
  .linkArea .link-leftBox .txt,
  .linkArea .link-rightBox .txt {
    padding: 20px;
  }
  .linkArea .link-leftBox .txt h3 a,
  .linkArea .link-rightBox .txt h3 a {
    font-size: 22px;
  }
  .linkArea .txt p {
    overflow: hidden;
    text-overflow: ellipsis;
    display: -webkit-box;
    -webkit-box-orient: vertical;
    -webkit-line-clamp: 3;
    font-size: 14px;
    line-height: 22px;
  }
  .featureList .item .txt {
    padding: 20px 0;
    > * {
      margin: auto 20px;
    }
  }
  .featureList .item .txt h3 a {
    font-size: 22px;
  }
  .bookBox{
    padding: 40px 20px;
  }
  .bookBox h3{
    font-size: 40px;
    margin-bottom: 25px;
  }
  .menu {
    padding: 40px 20px 10px;
  }
  .menu-top {
    flex-direction: column;
    margin-bottom: 00px;
  }
  .menu-top .languageBox {
    margin: 0;
  }
  .languageBox span {
    padding: 12px 40px;
  }
  .menu-top span::after {
    display: none;
  }
  .menu-item li {
    width: 33.333%;
    margin-bottom: 10px;
  }
  .menu-item li a {
    font-size: 14px;
  }
}

