.loading{
    width: 100%;
    height: 100vh;
    background: $color-main;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    position: fixed;
    left: 0;
    top: 0;
    z-index: 10000;
    display: none;
    opacity: 0;
    transition: .5s;
}
.loading img{
    width: 50px;
    animation: imgin .8s ease-in-out;
}
@keyframes imgin{
    0%{
        opacity: 0;
        transform: translateX(30px);
    }
    100%{
        opacity: 1;
        transform: translateX(0);
    }
}
.loading::after{
    content: '';
    display: block;
    width: 160px;
    height: 40px;
    background: url("../images/logo_text.png") no-repeat;
    background-size: contain;
    margin-top: 8px;
    animation: logoin 1.2s ease-in-out .8s ;
    opacity: 0;
}
@keyframes logoin{
    0%{
        opacity: 0;
    }
    100%{
        opacity: 1;
    }
}
.loading.show{
    display: flex;
    overflow-y: hidden;
    pointer-events: unset;
    opacity: 1;
}
